	//
	// Note: This event is experimental.
	FrameSubtreeWillBeDetached(context.Context) (page.FrameSubtreeWillBeDetachedClient, error)

	// Event FrameNavigated
	//
	// Fired once navigation of the frame has completed. Frame is now
